const sharp = require("sharp");

const base64 = ``;

const resize = () => {
  let imgBuffer = Buffer.from(base64, "base64");
  sharp(imgBuffer)
    .resize({ width: 1728, fit: "contain" })
    .extract({ left: 52, top: 492, width: 178, height: 32 })
    .toBuffer()
    .then((data) => {
      console.log("success", Buffer.from(data).toString("base64"));
    })
    .catch((err) => console.log(`downisze issue ${err}`));
};

resize();
